    /**
     * NearestPostalCode constructor. Instantiates the NearestPostalCode instance
     */
    public function __construct()
    {
        $this->json_postal_code = json_decode(NearestPostalCode::POSTAL_CODE_COORDINATE);
    }


    /**
     * Finds and returns the postal codes nearest to the given postal code and radius
     *
     * @param $postal_code
     * @param $radius
     * @return array|null
     */
    public function nearest($postal_code, $radius) {

        // Used to extract coordinates
        $given_location = (new PostalCoder())->geocode($postal_code);
        if(is_null($given_location)) {
            return null;
        }

        return $this->nearestUsingCoordinates($given_location->getLatitude(), $given_location->getLongitude(), $radius);
    }

    /**
     * Finds and returns the postal codes nearest to the given coordinates and radius
     *
     * @param $latitude
     * @param $longitude
     * @param $radius
     * @return array|null
     */
    public function nearestUsingCoordinates($latitude, $longitude, $radius) {

        // Check validity of parameters
        if(is_null($latitude) || is_null($longitude) || is_null($radius) ||
            (!is_double($latitude) && !is_int($latitude)) ||
            (!is_double($longitude) && !is_int($longitude)) ||
            (!is_double($radius) && !is_int($radius))) {
            return null;
        }

        $math = new Geokit\Math();

        // Array to be returned of nearest postal codes from the given postal code and distance
        $nearest_postal_codes = array();

        // Obtain all postal codes from the JSON array that falls within the radius
        foreach($this->json_postal_code as $compared_location) {

            // Distance between the given location and the compared location
            $distance = $math->distanceHaversine([$latitude, $longitude],
                [$compared_location->latitude, $compared_location->longtitude])
                ->kilometers();

            if($distance <= $radius) {
                $nearest_postal_codes[] = $compared_location->code;
            }
        }
        return $nearest_postal_codes;
    }
